import styled from 'styled-components';


export const Ul = styled.ul`
ul {
  list-style: none;
  padding: 50px;
  list-style-position: inside;
}

ul li {
  margin-bottom: 15px;
  text-align: center;
  list-style: none;
}

.center {
  display: block;
  margin-left: auto;
  margin-right: auto;
}
`

export const LoadingGif = styled.div`
.center {
  display: block;
  margin: auto;
  margin-top: 10%;
}
`
